delivery_info:
Доставка осуществляется в рабочие дни с 1000 до 1900, в субботу с 1100 до 1600
Товары, заказанные в воскресенье, доставляются в понедельник;
При дополнительном согласовании возможна доставка в любой удобный для Вас день;

worktime_info:
С ПН по ПТ: с 9-00 до 20-00;
СУББ: с 9-00 до 14-00;
Восскресения, Новый Год, Рождество, 8 Марта - выходные)
